import React from 'react' 
import { BrowserRouter, Switch, Link, Route } from 'react-router-dom';

class TarjetaFormulario extends React.Component {
    render() {
        return(
            <div className="card col l6 s12 tarjetahotel" key= {tarjeta.id}>
                                <div className="card-image waves-effect waves-block waves-light">
                                    <img className="activator" src="https://www.nopuedocreer.com/wp-content/images/2009/06/bicho_malo_2.jpg" alt = "imagen del hotel"/>
                                </div>
                                <div className="card-content">
                                    <span className="card-title activator grey-text text-darken-4"><strong>hola mundo</strong><i className="material-icons right">more_vert</i></span>
                                    <p><Link to="/hotel">la vida es bella</Link></p>
                                </div>
                                <div className="card-reveal">
                                    <span className="card-title grey-text text-darken-4">hola a todos<i className="material-icons right">close</i></span>
                                    <p>aqui vamos a poner cosas</p>
                                </div>
                            </div>
        )
    }
}

export default TarjetaFormulario
